measurements.description:
Fifty-three slightly cupped flowers and three buds on three up to 88-cm pendent inflorescences;
	sepals and petals yellow overlaid and speckled dark rose coalescing into stripes, yellow picotee;
	lip yellow overlaid maroon spots; 
	column yellow brushed dark rose apically, maroon spots basally and underside, anther cap white;
	substance firm; texture matte.
